import React, { useState } from 'react';
import {
    Container
}from 'reactstrap';
import {useFetch} from '../Hooks/useFetch';

export const Forms=()=>{
    const [count,setCount] =useState(0);
    const url = 'http://numbersapi.com/43/trivia';
    const {data,loading} = useFetch(url);
    return(
        <Container>
            <p>{loading ? '...wait': data}</p>
            <h2>number:{count}</h2>
        </Container>
    )
}
